import React from "react";
import styles from "./CardVideo.module.scss";

const CardVideo = () => {
	return (
		<div className={styles.CardVideo}>
			<div className={styles.progress}>
				<div className={styles.progressText}>Prvw</div>
			</div>
		</div>
	);
};

export default CardVideo;
